import React from 'react';
import { brandsStyles } from './styles.js';

export function Brands({ brands }) {
  return (
    <>
      <article className="brands">
        {brands.map(brand => {
          const {
            image,
            logo,
            title,
            clothingStyles,
            location,
            price,
            website,
          } = brand.fields;

          return <Brand />;
        })}
      </article>
      <style jsx>{brandsStyles}</style>
    </>
  );
}
